INSERT INTO `news` VALUES (54, 25, 1, '商家申请', 0, '管理员', '商家申请', '商家申请', '<p style=\"margin-bottom: 11px;text-align: left;white-space: normal\"><span style=\"font-size: 32px;font-family: Arial, sans-serif\">本公司</span><span style=\"font-size: 32px;font-family: 宋体\">法币交易区认证商家服务协议</span></p><p style=\"text-align: left;white-space: normal\"><br/></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal;vertical-align: middle\"><span style=\"font-size: 16px;font-family: 宋体\">本公司-OTC</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">请确认，在开始“认证商家”前，您已详细阅读了本协议以及本网站上相关法律文件以及规则的所有内容，一旦您开始认证流程，即表示您充分理解并同意接受本协议以及本网站上相关法律文件以及交易规则的全部内容。为了提高交易的安全性和本平台注册用户身份的可信度，本公司专业站（以下简称本网站）向您提供认证服务。您申请认证时，本网站有权采取各种其认为必要的措施对用户身份进行识别，但是，作为普通的网络服务提供商，本网站对用户身份识别结果的准确性和绝对真实性不做任何保证。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（一）认证所需材料</span></strong></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">1.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">手机号码；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">2.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">邮箱号码；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">3.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">微信号码；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">4.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">紧急联系人、紧急联系人号码、与本人关系；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">5.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">常住地址；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">6.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">本人户口本页；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">7.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">地址证明（房产证、租房合同或水电费清单）；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">8.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">视频证明（按范本要求录制）；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">9.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">本平台为合规而要求提交的其它材料。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span><strong><span style=\"font-size: 16px;font-family: 宋体\">（二）资产保证金</span></strong></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">1.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">在认证商家通过平台KYC与反洗钱审查后，本平台将要求认证商家在其平台账户中存入一定的保证金，以保障其在平台上的交易安全和顺畅。</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">2.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">保证金具体数额会在本平台上的认证商家的个人信息中展示。</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">3.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">如出现以下情形时，本平台有权对认证商家的保证金进行扣除等处置：</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">认证商家在交易过程中发生纠纷，且认证商家被判定应承担责任并履行相应义务，而认证商家不予配合的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">认证商家与本平台上未实名的账号进行交易的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">认证商家利用本平台从事任何非法行为的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">认证商家违反本协议或本网站上的任何法律文件规定或交易规则的</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（三）认证流程</span></strong></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">1.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">您提交认证商家申请材料；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">2.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">在收到您提交的认证材料之后，本网站将根据这些材料对您进行KYC和反洗钱等合规审查；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">3.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">在您通过本网站的KYC和反洗钱等合规审查之后，本平台将提供给您专属的认证商家的标识，从而与未认证商家进行区分；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">4.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">您向认证商户所属的保证金账户转入约定的保证金，认证商户无法对该账户内资金进行交易或划转。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（四）认证解除</span></strong></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">1.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">如认证商家需要解除认证的，须向本网站提交解除申请。在收到解除申请后，如本平台确认认证商家不涉及任何未决纠纷的，或无不良记录等情况的,本网站将于3个工作日内完成认证解除，且将保证金账户内剩余资金划转至您指定的接收账户中。</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">2.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">如果出现下列情形的，本平台有权单方解除您的认证商家资格：</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">交易中多次被本平台用户投诉的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">提交的认证材料中存在任何虚假信息的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">交易中出现欺诈等不诚信行为的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">积分不足60分的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">不配合本平台客服处理订单或故意拖延客服处理订单的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">恶意利用本平台规则牟利的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">违反法律法规、本协议、或本网站法律文件或交易规则规定的；或</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">存在本平台认定的不符合公序良俗、公平交易的行为。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（五）关于认证服务的理解与认同</span></strong></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">1.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">认证服务是由本网站提供的一项身份识别服务。除非本协议另有约定，一旦您在本网站账户完成了认证，相应的身份信息和认证结果将不因任何原因被修改或取消；如果您的身份信息在完成认证后发生了变更，您应向本网站提供相应有权部门出具的凭证，由本网站协助您变更您账户对应的认证信息。</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">2.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">本网站有权单方随时修改或变更本协议内容，并通过本网站公告变更后的协议文本，无需单独通知您。本协议进行任何修改或变更后，您还继续使用本网站提供的服务，即代表您已阅读、了解并同意接受变更后的协议内容；您如果不同意变更后的协议内容，应立即停用本网站的服务。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（六）关于认证材料的使用</span></strong></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">认证资料的管理：您在认证时提交给本网站的认证资料，即不可撤销地授权由本网站保留。本网站承诺除法定或约定的事由外，不公开、编辑或透露您的认证资料，且不将保存在本网站的非公开内容用于商业目的，但以下情形除外： 您授权本网站透露的相关信息；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">本网站向国家司法及行政机关提供；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">本网站向本网站关联企业提供；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">第三方和本网站一起为用户提供服务时，该第三方向您提供服务所需的相关信息（不包括您的银行账户信息）；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:13px;font-family:Symbol\">·<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">基于解决您与第三方民事纠纷的需要，本网站有权向该第三方提供您的身份信息。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（七）第三方网站的链接</span></strong></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">为实现身份信息审查，本网站上可能包含指向第三方网站（如网上银行网站）的链接（以下简称“链接网站”）。“链接网站”非由本网站控制，对于任何“链接网站”的内容，包含但不限于“链接网站”内含的任何链接，或“链接 网站”的任何改变或更新，本网站均不予负责。自“链接网站”接收的网络传播或其它形式之传送，本网站不予负责。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（八）不得为非法或禁止的使用</span></strong></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">接受本协议全部条款是您申请认证的先决条件。您声明并保证，您不得为任何非法或为本协议所禁止之目的进行认证申请。您不得以任何可能损害、使瘫痪、使过度负荷或损害其他网站或其他网站的服务或本网站或干扰他人对于认证商家申请的使用等方式使用认证服务。您不得未经本网站许可提供的任何方式取得或试图取得任何资料或信息。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（九）有关免责</span></strong></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">以下情形，本网站不承担任何责任：</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">1.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">由于您将账户密码告知他人或未保管好自己的密码或与他人共享账户或任何其他非本网站的过错，导致您的个人资料泄露的；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">2.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">任何由于黑客攻击、计算机病毒侵入或发作、电信部门技术调整导致之影响、因政府管制而造成的暂时性关闭、由于第三方原因(包括不可抗力，例如国际出口的主干线路及国际出口电信提供商一方出现故障、火灾、水灾、雷击、地震、洪水、台风、龙卷风、火山爆发、瘟疫和传染病流行、罢工、战争或暴力行为或类似事件等)及其他非因本网站过错而造成的认证信息泄露、丢失、被盗用或被篡改等；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">3.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">由于与本网站链接的其它网站（如网上银行等）所造成的银行账户信息泄露及由此而导致的任何法律争议和后果；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">4.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">任何因用户向本网站提供错误、不完整、不实信息等造成不能通过认证或遭受任何其他损失，概与本网站无关；</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">5.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">因非本平台之原因，您的资产被他人欺诈的。</span></p><p style=\"text-align: left;white-space: normal\"><span style=\"font-size: 16px;font-family: 宋体\">&nbsp;</span></p><p style=\"text-align: left;white-space: normal\"><strong><span style=\"font-size: 16px;font-family: 宋体\">（十）特别声明</span></strong></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">1.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">本网站对认证商家进行的基本资料审查和保证金要求，并不代表认证商家100%可信，也不代表本网站与认证商家之间存在任何保证关系。请本网站用户严格按照流程交易，做好对交易方的资料审核，详尽沟通，保证自身的交易和资产安全！同时，基于数字资产交易的特殊性，您需要格外注意反洗钱方面的风险，按照KYC和反洗钱的要求对您交易的相对方的身份进行审查，否则您将可能因交易相对方涉嫌犯罪而面临资产冻结等风险。</span></p><p style=\"margin-top:auto;margin-bottom: auto;margin-left:20px;text-align:left\"><span style=\"font-size:16px;font-family:宋体\">2.<span style=\"font-stretch: normal;font-size: 9px;line-height: normal;font-family: &#39;Times New Roman&#39;\">&nbsp;</span></span><span style=\"font-size: 16px;font-family: 宋体\">本网站对认证商家进行的基本资料审查和保证金要求，并不代表认证商100%可信，也不代表本网站与认证商家之间存在任何保证关系。请本网站用户严格按照流程交易，做好对交易方的资料审核，详尽沟通，保证自身的交易和资产安全！同时，基于数字资产交易的特殊性，您需要格外注意反洗钱方面的风险，按照KYC和反洗钱的要求对您交易的相对方的身份进行审查，否则您将可能因交易相对方涉嫌犯罪而面临资产冻结等风险。</span></p><p style=\"white-space: normal\">&nbsp;</p><p><br/></p>', 0, '2019-07-20 10:26:00', '2020-04-29 15:09:27', 'images/zwtp.png', 'images/zwtp.png');
INSERT INTO `news` VALUES (55, 25, 1, '公司简介', 0, '管理员', '公司简介', '公司简介', '<p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 35px\"><strong><span style=\"font-size: 30px;font-family: Times, serif\">&nbsp;</span></strong><strong><span style=\"font-size: 30px;font-family: &#39;PingFang SC&#39;, sans-serif\">Junex Foudation PTE.LTD</span></strong><strong><span style=\"font-size: 30px;font-family: &#39;PingFang SC&#39;, sans-serif\">基</span></strong><strong><span style=\"font-size: 30px;font-family: &#39;PingFang SC&#39;, sans-serif\">金会介绍</span></strong></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><strong><span style=\"font-size: 19px;font-family: Times, serif\">Junex Foudation PTE.LTD</span></strong><span style=\"font-size: 19px;font-family: Times, serif\">&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">是全球领先的数字资产金融服务商，由新加坡会计与企业管理区</span><span style=\"font-size: 19px;font-family: Times, serif\">(ACRA)</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">批准建立，受新加坡公司法监管，基金会将通过建立的治理结构，管理开源社区项目的一般事宜和特权事项。</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">基金会通过区块链数据结构，实现商品原料采集、生产、入库、出库、配送物流、门店、上架盘点、销售、用户体验、用户购买、用户评价、售后服务等流程区块链化，实现用户、店家、合作伙伴、第三方、地方政府等相关方的共赢利益，保证项目管理的有效性、可持续性和安全性，推进溯源防伪区块链技术的发展推广，将溯源防伪区块链技术与更多场景结合，通过通用积分奖励、营销激励、电子商务、传感器奖励等一系列措施，实现</span><span style=\"font-size: 19px;font-family: Times, serif\">BEAU&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">的生成、赠送、交易等功能，建立基于区块链的美容保健生态系统。</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">以</span><span style=\"font-size: 19px;font-family: Times, serif\">“</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">让金融更高效，让财富更自由</span><span style=\"font-size: 19px;font-family: Times, serif\">”</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">为使命，秉承</span><span style=\"font-size: 19px;font-family: Times, serif\">“</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">用户至上</span><span style=\"font-size: 19px;font-family: Times, serif\">”</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">的服务理念，致力于为全球用户提供安全、专业、诚信、优质的数字资产金融服务。</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">自</span><span style=\"font-size: 19px;font-family: Times, serif\">2017&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">年创立以来，</span><strong><span style=\"font-size: 19px;font-family: Times, serif\">Junex Foudation PTE.LTD</span></strong><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">获得日本</span><span style=\"font-size: 19px;font-family: Times, serif\">J&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">集团总股本超过</span><span style=\"font-size: 19px;font-family: Times, serif\">200&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">亿日元投资。并在次年累积交易额突破</span><span style=\"font-size: 19px;font-family: Times, serif\">1&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">亿美元，一度成为全球颇具影响力数字资产交易平台。目前，</span><strong><span style=\"font-size: 19px;font-family: Times, serif\">Junex Foudation PTE.LTD</span></strong><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">已投资</span><span style=\"font-size: 19px;font-family: Times, serif\">30&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">余家上下游企业，现已完成对新加坡、中国、日本、韩国、美国、澳大利亚、泰国、老挝、中国香港、中国台湾等多个国家及地区合规服务团队的组建，为全球超过</span><span style=\"font-size: 19px;font-family: Times, serif\">130&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">个国家的数百万用户提供安全、可信赖的数字资产交易及资产管理服务。</span></p><p style=\";font-size: 14px;font-family: DengXian;white-space: normal;line-height: 19px\"><span style=\"font-size: 16px;font-family: Times, serif\">&nbsp;</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 37px\"><strong><span style=\"font-size: 32px;font-family: &#39;PingFang SC&#39;, sans-serif\">菅原淳司</span></strong></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">董事会长</span><span style=\"font-size: 19px;font-family: Times, serif\">&amp;CEO</span> INSERT INTO `news` VALUES (56, 24, 1, '杠杆交易指引', 0, '管理员', '杠杆交易指引', '杠杆交易指引', '', 0, '2019-07-20 10:26:00', '2019-07-20 10:26:00', 'https://www.bitex.ren/images/zwtp.png', '');
