INSERT INTO `news` VALUES (64, 26, 1, '隐私条款', 0, '本公司', '0', '0', '<p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal\"><span style=\"font-size: 14px;font-family: 宋体\">1111一、双方</span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">1.1&nbsp;</span><span style=\"outline: 0px;box-sizing: border-box\">本公司</span><span style=\"font-size: 14px;font-family: 宋体\">隶属一家根据新加坡法律注册成立的</span><span style=\"font-size: 14px;font-family: SimSun\">Junex Foudation PTE.LTD</span><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;<span style=\"font-size: 14px\">（以下称基金公司）。该基金公司的运营网站</span><span style=\"outline: 0px;box-sizing: border-box\">https://xxx.xxx.com</span></span><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\">，</span></span><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\">该网站是一个专门供用户进行数字资产交易和提供相关服务（以下称</span>“该服务”或“服务”）的平台。为了本协议表述之方便，公司和该网站在本协议中合称使用“我们”或其他第一人称称呼。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">1.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">只要登陆该网站的自然人或其他主体均为本网站的用户，本协议表述之便利，以下使用“您”或其他第二人称。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">1.3&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">为了本协议表述之便利，我们和您在本协议中合称为“双方”，我们或您单称为“一方”。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">二、隐私政策制定的目的</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">隐私政策规定了我们只通过您登陆本网站、在本网站上注册和</span>/或使用我们提供的服务采集您信息的类型以及我们如何使用和保护这些采集到的信息。</span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">三、</span><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\">您的同意</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">为确保您对我们在处理个人资料上有充分信心</span>,&nbsp;您切要详细阅读及理解隐私政策的条文。特别是您一旦登陆我们的网站，不论您是否在该网站上注册，您均向我们表明您接受、同意、承诺和确认：</span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">3.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">您在自愿下连同所需的同意向我们披露个人资料；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">3.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">您会遵守本隐私政策的全部条款和限制；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">3.3&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">您同意我们通过您登陆本网站、在本网站上注册和/或使用我们提供的服务收集您的信息；您同意日后我们对隐私政策的任何修改；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">3.4&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">您同意我们的分公司、附属公司、雇员就您可能会感兴趣的产品和服务与您联络(&nbsp;除非您已经表示不想收到该等讯息)。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">四、收集的信息</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">4.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">当您使用本网站时，您同意我们开始使用cookies来追踪您的每一个动作，并收集和记住您留下的所有信息，其中包括但不限于您的IP地址，地理位置及其他资料。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">4.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">如果您愿意使用本网站提供的服务，您需要填写和提供以下两种信息：</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">4.2.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">身份信息。该信息可以帮助我们验证您是否有资格注册为本网站会员，包括但不限于您的名字、您的居住地址、邮寄地址、您所属国家或政府签发的其他具有证明您身份信息的不同的证书以及涉及到的号码及所有其他可帮助我们验证您身份的信息（以下合称为“身份信息” ）。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">4.2.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">服务信息。该信息帮助我们与您联系并顺利为您提供服务，包括但不限于您的电话号码、传真号码、有效的电子邮件地址、邮寄地址以及您的借记卡信息和/或其他帐户信息（以下合 称为“服务信息” ）。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">4.3&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">在您使用本网站或其提供的服务时，我们可能会为了改进本网站的使用功能，提升您对使用本网站及其提供的服务及其安全性的体验或是根据法院或可适用法律法规或有管辖权的其他政府机构的命令，通过本网站公示的专属于我们的邮箱或其他我们认为合规的方式收集更多的必要的信息。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">4.4&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">如果您访问了在本网站上的其他第三方网站或合作的第三方的任何链接，您应同意并遵守该第三方网单独和独立的隐私政策。我们对这些网站或合作方的内容及活动不承担任何责任。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">五、</span>Cookies</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">5.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">当您到访我们网站时,&nbsp;我们通过cookies使用Google Stats去记录我们的业绩以及核对在线广告的效果。Cookie是发送到您的浏览器上并在您的电脑硬盘驱动器上存储的小量数据。只有当您使用您的电脑进入我们网站时,Cookie才能够被发送到您的电脑硬盘上。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">5.2 Cookies</span><span style=\"font-size: 14px;font-family: 宋体\">常用于记录访问者浏览我们网站上的各个项目时的习惯以及偏好。Cookies所搜集的资料是不记名的集体统计数据,&nbsp;不载有个人资料。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">5.3 Cookies</span><span style=\"font-size: 14px;font-family: 宋体\">不能用于取得您的硬盘上的数据、您的电邮地址、及您的私人数据，其可使本网站或服务商系统识别到您的浏览器并捕捉和记忆信息。大多数浏览器都预设为可以接受Cookies。您可以选择将您的浏览器设定为不接受Cookies,或如果Cookies一被装上就通知您。不过,&nbsp;若设定为禁止Cookies,&nbsp;您或许便不能启动或使用我们网站的某些功能。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">六、信息使用用途</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">我们为了以下目的或以下列方式使用我们收集到的您的信息：</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">通过我们的网站向您提供我们的各项服务；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">当您使用我们的网站时,&nbsp;能辨认及确认您的身份；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.3&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">为了改善和提高网站的服务（根据我们收到的您的信息及反馈，帮助我们改善网站的服务，进而我们可以更有效地对您的服务请求和支持需求做出回应）；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.4&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">统计我们网站使用量的数据和政府机关、事业单位等合作的数据分析；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.5&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">个性化您的体验（您的信息将帮助我们更好地为您的个性化需求作出回应）；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.6&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">处理交易（您的信息，无论是公共或私人的，未经您的同意不会以任何理由被出售、交换、转移，或提供给任何其他公司，但除了为完成您所要求的交易的明确目的之外 ）；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.7&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">定期发送电子邮件（您提供订单处理的电子邮件地址，除了偶尔接收我们的新闻，更新，相关产品或服务的信息等，可用来向您发送信息和更新有关您的订单）；</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.1.8&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">满足本网站用户协议规定的其他目的和为了满足该等目的的所有合法途径。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">6.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">我们不会向其他方出售、交易或以其他方式转让信息或允许他人收集、使用信息，但不包括以下其他方和以下信息：我们的关联方、帮助我们经营我们的网站、开展业务、或者向您提供服务的受信任的第三方，只要这些当事方同意将这些信息保密；当我们相信披露的信息是适当的，是遵守法律、法规、规章制度的或来自于法院或他主管当局的命令、执行我们的网站策略，正常运行网站所需要，关联方提供服务所需或保护我们或他人的权利、财产或安全的。但是，您的信息不会提供给其他方进行营销，广告或其他用途。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">七、个人资料的保护</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">我们实施妥善的实物、电子、管理及技术方面的措施来保护和保障您的个人资料的安全。我们尽力确保通过我们网站所搜集的任何个人资料皆免于任何与我们无关的第三者的滋扰。我们采取的安全措施包括但不限于：</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.1.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">实物措施：存有您个人资料的记录会被存放在有锁的地方。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.1.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">电子措施：存有您个人资料的电脑数据会被存放在受严格登入限制的电脑系统和存储媒体上。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.1.3&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">管理措施：只有经我们授权的职员才能接触到您的个人资料,&nbsp;这些职员需要遵守我们个人资料保密的内部守则。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.1.4&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">技术措施：可能采用如Secure Socket Layer Encryption这种加密技术来输送您的个人资料。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.1.5&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">其它措施：我们的网络服务器受到“防火墙”的保护。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">若您知悉我们的网站上有任何安全方面的漏洞,&nbsp;请马上联系我们,&nbsp;使我们可以尽快采取妥适的行动。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">7.3&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">尽管实施了上述技术和保安的措施,&nbsp;我们不能保证资料在互联网上的输送绝对安全,&nbsp;因此我们不能绝对保证您通过我们网站提供给我们的个人资料在一切时候都是安全的。对任何因未经授权而接触您个人资料所发生的事件我们一槪不承担责任,&nbsp;于这方面产生或导致的任何损失或损害,&nbsp;我们不负责赔偿。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">八、</span><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\">隐私政策的修订</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">我们保留随时修改该隐私政策的权利。我们通过更新和发布新版本的生效日期告诉您我们修订了隐私政策，并突出修订处，有时我们会发布通知告诉您隐私政策已修订，但这不是我们的一项义务。您应定期查看隐私政策并关注其修订情况，如果您不同意修订的内容，您应停止立即访问本网站。当隐私政策的更新版本发布，您持续访问本网站显示和表明您同意该更新的内容，并同意遵守该更新的隐私权政策。</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">九、与我们的沟通</span></span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">9.1&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">如果您有任何要求和意见，您可以通过电子邮件btc360beau@hotmail.com，这是属于我们与您沟通的唯一有效和官方电子邮件，所以我们对您未使用有效的联系方式，任何作为或不作为不承担责任。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">9.2&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">我们只通过本网站上的有效的联系方式发布公告和信息或在本网站张贴公告，所以我们对由于您信任了未通过以上方式获得的信息而产生的任何损失不承担责任。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">9.3&nbsp;</span><span style=\"font-size: 14px;font-family: 宋体\">若您对我们的隐私政策有任何问题,&nbsp;欢迎随时联系我们。</span></span></p><p style=\";font-size: medium;font-family: \'Times New Roman\', serif;white-space: normal;outline: 0px;box-sizing: border-box;caret-color: rgb(99, 112, 133)\"><span style=\"outline: 0px;box-sizing: border-box\"><span style=\"font-size: 14px;font-family: 宋体\">&nbsp;</span></span></p><p style=\";font-size: 14px;font-family: DengXian;text-align: justify;white-space: normal\">&nbsp;</p><p><br></p>', 0, '2019-07-20 10:26:00', '2020-04-29 15:09:28', 'images/zwtp.png', 'images/zwtp.png');
INSERT INTO `news` VALUES (65, 26, 1, '法律声明', 0, '本公司', '0', '0', '<p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第一条</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">本网站的宗旨是在不违反</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">新加坡</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">共和国相关法律法规的前提下，尽可能地为全球广大数字资产爱好者及投资者提供专业的国际化水准的交易平台和金融产品。禁止使用本网站从事洗钱、走私、商业贿赂等一切非法交易活动，若发现此类事件，本站将冻结账户，立即报送有权机关。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第二条</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">当有权机关出示相应的调查文件要求本站配合对指定用户进行调查时，</span> <span style=\"font-family:宋体\">或对用户账户采取查封、冻结或者划转等措施时，本站将按照有权机关的要求协助提供相应的用户数据，或进行相应的操作。</span> <span style=\"font-family:宋体\">因此而造成的用户隐私泄露、账户不能操作及因此给所造成的损失等，本站不承担任何责任。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第三条</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">本网站使用者因为违反本声明的规定而触犯</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">新加坡</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">共和国相关法律的，本站作为服务的提供方，有义务对平台的规则及服务进行完善，</span> <span style=\"font-family:宋体\">但本站并无触犯</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">新加坡</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">共和国相关法律的动机和事实，对使用者的行为不承担任何连带责任。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第四条</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">凡以任何方式登录本网站或直接、间接使用本网站服务者，视为自愿接受本网站声明的约束。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">第五条</span></span></p><p><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">本声明未涉及的问题参见</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">新加坡</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">共和国有关法律法规，当本声明与</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">新加坡</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">共和国相关法律法规冲突时，以</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">新加坡</span></span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">共和国相关法律法规为准。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p>', 0, '2019-10-15 14:31:00', '2020-04-29 15:09:28', 'images/zwtp.png', 'images/zwtp.png');
INSERT INTO `news` VALUES (66, 26, 1, '用户协议', 0, '管理员', '用户协议', '用户协议', '<p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-family: &#39;Open Sans&#39;\">本公司</span><span style=\"font-family: 宋体\">交易所</span><span style=\"font-family: &#39;Open Sans&#39;\">.</span><span style=\"font-family: DengXian\">（以下称</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">公司</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">）是一家由新加坡</span><span style=\"font-family: &#39;Open Sans&#39;\">IBS</span><span style=\"font-family: DengXian\">基金会联合创办的公司，该公司运营网站</span><span style=\"font-family: &#39;Open Sans&#39;\">https://xxx.xxx.com</span><span style=\"font-family: DengXian\">（以下称</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">本网站</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">或</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">网站</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">），该网站是一个专门供用户进行数字资产交易和提供相关服务（以下称</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">该服务</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">或</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">服务</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">）的平台。为了本协议表述之方便，公司和该网站在本协议中合称使用</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">我们</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">或其他第一人称称呼。只要登陆该网站的自然人或其他主体均为本网站的用户，本协议表述之便利，以下使用</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">您</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">或其他第二人称。为了本协议表述之便利，我们和您在本协议中合称为</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">双方</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">，我们或您单称为</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">一方</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">。本网站所有内容，为便利用户，可能提供多个语言版本，若有冲突或遗漏等情况，以中文内容为准。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 14px;font-family: DengXian\">重要提示：</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 14px;font-family: DengXian\">我们在此特别提醒您：</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1&nbsp;</span><span style=\"font-family: DengXian\">数字资产本身不由任何金融机构或公司或本网站发行；</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">2&nbsp;</span><span style=\"font-family: DengXian\">数字资产市场是全新的、未经确认的，而且可能不会增长；</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">3&nbsp;</span><span style=\"font-family: DengXian\">数字资产主要由投机者大量使用，零售和商业市场使用相对较少，数字资产交易存在极高风险，其全天不间断交易，没有涨跌限制，价格容易受庄家、全球政府政策的影响而大幅波动；</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4&nbsp;</span><span style=\"font-family: DengXian\">如果公司根据其单方判断认为您违反了本协议，或者根据您所在管辖区域的法律本网站提供的服务或者您使用本网站提供的服务的行为是非法的，公司有权随时暂停或终止您的账户，或者暂停或终止您使用本网站提供的服务或数字资产交易。</span><span style=\"font-family: &#39;Open Sans&#39;\">&nbsp;</span><span style=\"font-family: DengXian\">禁止位于美国的任何人使用本网站提供的服务。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 14px;font-family: DengXian\">数字资产交易有极高风险，并不适合绝大部分人士。您了解和理解此投资有可能导致部分损失或全部损失，所以您应该以能承受的损失程度来决定投资的金额。您了解和理解数字资产会产生衍生风险，所以如有任何疑问，建议先寻求理财顾问的协助。此外，除了上述提及过的风险以外，还会有未能预测的风险存在。您应慎重考虑并用清晰的判断能力去评估自己的财政状况及上述各项风险而作出任何买卖数字资产的决定，并承担由此产生的全部损失，我们对此不承担任何责任。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 14px;font-family: DengXian\">敬告您：</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1&nbsp;</span><span style=\"font-family: DengXian\">您了解本网站仅作为您获取数字资产信息、寻找交易方、就数字资产的交易进行协商及开展交易的场所，本网站不参与您的任何交易，故您应自行谨慎判断确定相关数字资产及</span><span style=\"font-family: &#39;Open Sans&#39;\">/</span><span style=\"font-family: DengXian\">或信息的真实性、合法性和有效性，并自行承担因此产生的责任与损失。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">2&nbsp;</span><span style=\"font-family: DengXian\">本网站的任何意见、消息、探讨、分析、价格、建议和其他资讯均是一般的市场评论，并不构成投资建议。我们不承担任何因依赖该资讯直接或间接而产生的损失，包括但不限于任何利润损失。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">3&nbsp;</span><span style=\"font-family: DengXian\">本网站的内容会随时更改并不作另行通知，我们已采取合理措施确保网站资讯的准确性，但并不能保证其准确性程度，亦不会承担任何因本网站上的资讯或因未能链结互联网、传送或接收任何通知和信息时的延误或失败而直接或间接产生的损失。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4&nbsp;</span><span style=\"font-family: DengXian\">使用互联网形式的交易系统亦存有风险，包括但不限于软件，硬件和互联网链结的失败等。由于我们不能控制互联网的可靠性和可用性，我们不会对失真，延误和链结失败而承担任何责任。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">5 https://xxx.xxx.com</span><span style=\"font-family: DengXian\">为本网站唯一官方对外信息公布平台；</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">6&nbsp;</span><span style=\"font-family: DengXian\">本网站任何服务均不接受信用卡支付；</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">7&nbsp;</span><span style=\"font-family: DengXian\">禁止使用本网站从事洗钱、走私、商业贿赂等一切非法交易活动或违法行为，若发现任何涉嫌非法交易或违法行为，本站将采取各种可使用之手段，包括但不限于冻结账户，通知相关权力机关等，我们不承担由此产生的所有责任并保留向相关人士追究责任的权利。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">8&nbsp;</span><span style=\"font-family: DengXian\">禁止使用本网站进行恶意操纵市场、不正当交易等一切不道德交易活动，若发现此类事件，本网站将对所有恶意操纵价格、恶意影响交易系统等不道德的行为采取警告、限制交易、关停账户等预防性地保护措施，我们不承担由此产生的所有责任并保留向相关人士追究责任的权利。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><em><span style=\"font-family: DengXian;font-style: normal\">一、总则</span></em></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1.1&nbsp;</span><span style=\"font-family: DengXian\">《用户协议》（以下称</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">本协议</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">或</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">本条款及条件</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">），由正文、《隐私条款》、《了解你的客户和反洗钱政策》以及本网站已经发布的或将来可能发布的各类规则、声明、说明等构成。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1.2&nbsp;</span><span style=\"font-family: DengXian\">您在使用本网站提供的各项服务之前，应仔细阅读本协议，如有不理解之处或其他必要，请咨询专业律师。如您不同意本协议及</span><span style=\"font-family: &#39;Open Sans&#39;\">/</span><span style=\"font-family: DengXian\">或随时对其的修改，请您立即停止使用本网站提供的服务或不再登陆本网站。您一旦登陆本网站、使用本网站的任何服务或任何其他类似行为即表示您已了解并完全同意本协议各项内容，包括本网站对本协议随时所做的任何修改。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1.3&nbsp;</span><span style=\"font-family: DengXian\">您通过按照本网站的要求填写相关信息，并经过其他相关程序后成功注册可以成为本网站的会员（以下称</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">会员</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">），在进行注册过程中点击</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">同意</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">按钮即表示您以电子签署的形式与公司达成协议；或您在使用本网站过程中点击任何标有</span><span style=\"font-family: &#39;Open Sans&#39;\">“</span><span style=\"font-family: DengXian\">同意</span><span style=\"font-family: &#39;Open Sans&#39;\">”</span><span style=\"font-family: DengXian\">或类似意思的按钮的行为或以其他本网站允许的方式实际使用本网站提供的服务时，均表示您完全了解、同意且接受本协议项下的全部条款的约束，无您手写的书面签字就本协议对您的法律约束力无任何影响。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1.4&nbsp;</span><span style=\"font-family: DengXian\">您成为本网站的会员后，您将获得一个会员帐号及相应的密码，该会员帐号和密码由会员负责保管；会员应当对以其您帐号进行的所有活动和事件负法律责任。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1.5&nbsp;</span><span style=\"font-family: DengXian\">只有成为本网站的会员才可使用本网站提供的数字资产交易平台进行交易及享受其他本网站规定的只有会员才可获得的服务；会员外的其他您只有登陆网站、浏览网站及其他本网站规定的可获得的服务。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1.6&nbsp;</span><span style=\"font-family: DengXian\">通过注册和使用任何由本网站提供的服务和功能，您将被视为已阅读，理解并：</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">1.6.1&nbsp;</span><span style=\"font-family: DengXian\">接受本协议所有条款及条件的约束。</span></p><p style=\"margin-right: 0;margin-left: 0;font-