n style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4.2.4&nbsp;</span><span style=\"font-family: DengXian\">您在本网站进行数字资产交易时不得恶意干扰数字资产交易的正常进行、破坏交易秩序；不得以任何技术手段或其他方式干扰本网站的正常运行或干扰其他用户对本网站服务的使用；不得以虚构事实等方式恶意诋毁本网站的商誉。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4.2.5&nbsp;</span><span style=\"font-family: DengXian\">如您因网上交易与其他用户产生纠纷的，不得通过司法或行政以外的途径要求本网站提供相关资料。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4.2.6&nbsp;</span><span style=\"font-family: DengXian\">您在使用本网站提供的服务过程中，所产生的应纳税赋，以及一切硬件、软件、服务及其它方面的费用，均由您独自判断和承担。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4.2.7&nbsp;</span><span style=\"font-family: DengXian\">您应当遵守本网站不时发布和更新的本协议以及其他服务条款和操作规则，有权随时终止使用本网站提供的服务。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>&nbsp;</p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 14px;font-family: &#39;Open Sans&#39;\">4.3.</span><span style=\"font-size: 14px;font-family: DengXian\">产品规则</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span>&nbsp;</p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4.3.1</span><span style=\"font-family: DengXian\">交易产品规则</span><span style=\"font-family: DengXian\">您承诺在其进入本网站交易，通过本网站与其他用户进行交易的过程中良好遵守如下交易规则。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open Sans&#39;\">4.3.1.1&nbsp;</span><span style=\"font-family: DengXian\">浏览交易信息</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: DengXian\">您在本网站浏览交易信息时，应当仔细阅读交易信息中包含的全部内容，包括但不限于价格、委托量、手续费、买入或卖出方向，</span><span style=\"font-family: DengXian\">您完全接受交易信息中包含的全部内容后方可点击按钮进行交易。</span></p><p style=\"margin-right: 0;margin-left: 0;font-size: medium;font-family: &#39;Times New Roman&#39;, serif;white-space: normal\"><span style=\"font-size: 13px;font-family: Symbol\">·<span style=\"font-size: 9px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: &#39;Open 