-- ----------------------------
-- Table structure for account_draws
-- ----------------------------
DROP TABLE IF EXISTS `account_draws`;
CREATE TABLE `account_draws` (
  `id` int NOT NULL AUTO_INCREMENT,
  `currency_id` int NOT NULL COMMENT '币种ID',
  `user_id` int NOT NULL COMMENT '用户ID',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '提币地址',
  `number` decimal(30,8) NOT NULL COMMENT '提币数量',
  `status` smallint NOT NULL DEFAULT '1' COMMENT '状态1待审核2已通过3已驳回',
  `fee` decimal(20,8) NOT NULL COMMENT '手续费',
  `real_number` decimal(30,8) NOT NULL COMMENT '真实到账数量',
  `created_at` timestamp NOT NULL,
  `updated_at` timestamp NOT NULL,
  `review_at` int NOT NULL DEFAULT '0' COMMENT '审核操作时间',
  `tx_hash_id` int NOT NULL DEFAULT '0' COMMENT '关联hash表id',
  `use_chain_api` tinyint NOT NULL DEFAULT '1' COMMENT '是否走链上   0否  1是',
  `memo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `notes` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '说明',
  `account_type_id` int NOT NULL DEFAULT '0' COMMENT '账户类型ID',
  `currency_protocol_id` int NOT NULL DEFAULT '0' COMMENT '币种协议ID',
  PRIMARY KEY (`id`),
  KEY `user` (`user_id`,`currency_id`),
  KEY `status` (`status`,`currency_id`) USING BTREE,
  KEY `currency` (`currency_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='提币记录表';

