-- ----------------------------
-- Table structure for agents
-- ----------------------------
DROP TABLE IF EXISTS `agents`;
CREATE TABLE `agents` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT '代理商表',
  `user_id` int unsigned NOT NULL COMMENT '关联用户id  ',
  `username` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '登录代理商后台的帐号',
  `password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '登录代理商后台的密码',
  `parent_agent_id` int unsigned NOT NULL DEFAULT '0' COMMENT '父级代理商ID，0表示该用户是超级代理商',
  `level` tinyint unsigned NOT NULL DEFAULT '0' COMMENT '代理商等级,0:超级管理员； 1：一级代理商；2:二级代理商；3:三级代理商；4:四级代理商',
  `agent_path` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '代理商关系，用,拼接成字符串',
  `is_admin` tinyint NOT NULL DEFAULT '0' COMMENT '是否为超级管理员',
  `is_lock` tinyint NOT NULL DEFAULT '0' COMMENT '该代理商是否锁定',
  `is_addson` tinyint NOT NULL DEFAULT '1' COMMENT '是否拥有开设下级代理商的权限',
  `pro_loss` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '头寸比例',
  `pro_ser` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '手续费比例',
  `reg_time` int NOT NULL DEFAULT '0' COMMENT '代理商注册时间',
  `lock_time` int NOT NULL DEFAULT '0' COMMENT '代理商锁定时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of agents
-- ----------------------------
BEGIN;
COMMIT;

