-- ----------------------------
-- Table structure for lever_transaction
-- ----------------------------
DROP TABLE IF EXISTS `lever_transaction`;
CREATE TABLE `lever_transaction` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint unsigned NOT NULL DEFAULT '0' COMMENT '买卖类型:1.买入,2.卖出',
  `user_id` int unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `currency_match_id` int unsigned NOT NULL DEFAULT '0' COMMENT '交易对id',
  `base_currency_id` int unsigned NOT NULL DEFAULT '0' COMMENT '交易币id',
  `quote_currency_id` int unsigned NOT NULL DEFAULT '0' COMMENT '计价币id',
  `origin_price` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '原始价格',
  `price` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '开仓价格(点差处理之后)',
  `update_price` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '当前价格',
  `target_profit_price` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '止盈价格',
  `stop_loss_price` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '止亏价格',
  `share` int unsigned NOT NULL DEFAULT '0' COMMENT '手数',
  `number` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '手数换算数量(非放大的)',
  `multiple` tinyint unsigned NOT NULL DEFAULT '0' COMMENT '倍数',
  `origin_caution_money` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '初始保证金',
  `caution_money` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '当前可用保证金',
  `fact_profits` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '最终盈亏',
  `trade_fee` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '交易手续费',
  `overnight` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '隔夜费率,百分比',
  `overnight_money` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '隔夜费金额',
  `status` tinyint NOT NULL DEFAULT '0' COMMENT '交易状态:0.挂单中,1.交易中,2.平仓中,3.已平仓,4.已撤单',
  `settled` tinyint NOT NULL DEFAULT '0' COMMENT '结算状态:0.未结算,1.已结算',
  `create_time` int NOT NULL DEFAULT '0' COMMENT '下单时间',
  `transaction_time` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '交易时间',
  `update_time` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '价格刷新时间(毫秒级)',
  `handle_time` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '平仓时间',
  `complete_time` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '完成时间',
  `closed_type` int DEFAULT '0' COMMENT '平仓类型:0.未知,1.市价,2.暴仓,3.止盈,4.止损,5.后台	',
  `agent_path` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '用户代理商关系记录',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of lever_transaction
-- ----------------------------
BEGIN;
COMMIT;

