-- ----------------------------
-- Table structure for micro_orders
-- ----------------------------
DROP TABLE IF EXISTS `micro_orders`;
CREATE TABLE `micro_orders` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `match_id` int unsigned NOT NULL COMMENT '交易对id',
  `currency_id` int unsigned NOT NULL DEFAULT '0' COMMENT '支付的币种',
  `type` tinyint NOT NULL DEFAULT '0' COMMENT '买卖类型1.买涨,2.买跌',
  `is_insurance` tinyint NOT NULL DEFAULT '0' COMMENT '订单险种:0.无,1.正向，2反向。',
  `seconds` int unsigned NOT NULL DEFAULT '0' COMMENT '秒数',
  `number` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '下单数量',
