  `end_price` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '收盘价',
  `fee` decimal(20,4) unsigned NOT NULL COMMENT '手续费',
  `profit_ratio` decimal(3,2) unsigned NOT NULL COMMENT '收益率',
  `fact_profits` decimal(20,4) NOT NULL COMMENT '最终收益',
  `status` tinyint NOT NULL DEFAULT '0' COMMENT '状态:1.交易中,2.平仓中,3.已平仓',
  `pre_profit_result` tinyint NOT NULL DEFAULT '0' COMMENT '预设盈利状态:-1.亏损,0.未设置,1.盈利',
  `profit_result` tinyint NOT NULL DEFAULT '0' COMMENT '盈利结果:-1.亏损,0.平,1.盈利',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '提交日期',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新日期',
  `handled_at` timestamp NULL DEFAULT NULL COMMENT '平仓时间',
  `complete_at` timestamp NULL DEFAULT NULL COMMENT '完成时间',
  `agent_path` varchar(2048) DEFAULT '1' COMMENT '代理商关系',
  `settled` int NOT NULL DEFAULT '0' COMMENT '是否已给代理商结算1已结算',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `match_id` (`match_id`) USING BTREE,
  KEY `currency_id` (`currency_id`) USING BTREE,
  KEY `type` (`type`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `seconds` (`seconds`) USING BTREE,
  KEY `profit_result` (`profit_result`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1445 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC COMMENT='微合约订单表';

