<span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">毕业于早稻田大学法学部，曾就职于日本知名品牌化妆品公司工作。历任了国外品牌化妆品公司的部长、社长等职位。</span><span style=\"font-size: 19px;font-family: Times, serif\">2011&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">年</span><span style=\"font-size: 19px;font-family: Times, serif\">9&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">月，凭借自身丰富的运营及市场经验，创立了健康与美的综合企业，并于第一年完成了十亿日元的总销售额。其后，将事业触角延伸至海外，陆续与中国香港、泰国、韩国、马来西亚、越南、新加坡、阿联酋、中国台湾、中国大陆成立了当地公司法人，透过保养品</span><span style=\"font-size: 19px;font-family: Times, serif\">·</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">健康食品事业，打【健康与美的全球化】旗帜。</span> <span style=\"font-size: 19px;font-family: Times, serif\">Beau&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">正逐渐拓展全球。</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 31px\"><strong><span style=\"font-size: 27px;font-family: &#39;PingFang SC&#39;, sans-serif\">相田翔子</span></strong></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: Times, serif\">Chief Technology Officer&nbsp;</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">资深</span><span style=\"font-size: 19px;font-family: Times, serif\">C++</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">程序员</span><span style=\"font-size: 19px;font-family: Times, serif\">12&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">年开发经验，参与开发和管理过多个支付项目，曾就职</span><span style=\"font-size: 19px;font-family: Times, serif\">Paypal&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">支付公司。从</span><span style=\"font-size: 19px;font-family: Times, serif\">2012&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">年至今一直致力于对区块链技术的探索及应用，为</span><span style=\"font-size: 19px;font-family: Times, serif\">Worth chian&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">的技术团队建立了坚实的技术根基，也为实现</span><span style=\"font-size: 19px;font-family: Times, serif\">Worth chian&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">的战略构想提供充分的技术保障。</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 31px\"><strong><span style=\"font-size: 27px;font-family: &#39;PingFang SC&#39;, sans-serif\">稻穗周</span></strong></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 20px\"><span style=\"font-size: 17px;font-family: Arial, sans-serif\">Marketing Director&nbsp;</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">在汽车</span><span style=\"font-size: 19px;font-family: Times, serif\">·</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">航空航太工业</span><span style=\"font-size: 19px;font-family: Times, serif\">3D&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">雷射测量领域</span><span style=\"font-size: 19px;font-family: Times, serif\">,</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">做为分析软件的应用专员拥有长达</span><span style=\"font-size: 19px;font-family: Times, serif\">10&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">年的经历</span><span style=\"font-size: 19px;font-family: Times, serif\">,</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">现为</span><span style=\"font-size: 19px;font-family: Times, serif\">BlockchainNeo Japan&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">的营销总监。负责主导</span><span style=\"font-size: 19px;font-family: Times, serif\">Beau&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">项目</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 31px\"><span style=\"font-size: 27px;font-family: &#39;PingFang SC&#39;, sans-serif\">全球业务</span></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 29px\"><strong><span style=\"font-size: 25px;font-family: &#39;PingFang SC&#39;, sans-serif\">交易平台</span></strong></p><p style=\"margin: 0 0 16px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 19px;font-family: Times, serif\">2017&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">年，</span><strong><span style=\"font-size: 19px;font-family: Times, serif\">Junex Foudation PTE.LTD</span></strong><span style=\"font-size: 19px;font-family: Times, serif\">&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">全面开启国际化战略布局，以交易服务为布局重点，以</span><span style=\"font-size: 19px;font-family: Times, serif\">本公司&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">作为原点向全球区域辐射，先后完成对新加坡、中国、日本、韩国、美国、澳大利亚、泰国、老挝、中国香港、中国台湾等多个国家及地区合规服务团队的组建，致力为全球用户打造一站式全球化交易服务。</span></p><p style=\"margin: 0 0 18px 48px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 17px;font-family: Times, serif\">•</span><span style=\"font-size: 9px;font-family: &#39;Times New Roman&#39;, serif\">&nbsp;&nbsp;</span><span style=\"font-size: 19px;font-family: Times, serif\">本公司&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">全球站全球领先的数字资产交易平台，总部设立于新加坡。致力于发现优质的数字资产投资机会，提供数百种数字资产品类的交易及投资服务，由</span><strong><span style=\"font-size: 19px;font-family: Times, serif\">Junex Foudation PTE.LTD</span></strong><span style=\"font-size: 19px;font-family: Times, serif\">&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">业务团队负责运营。</span> </p><p style=\"margin: 0 0 18px 48px;font-size: 14px;font-family: DengXian;white-space: normal;line-height: 23px\"><span style=\"font-size: 17px;font-family: Times, serif\">•</span><span style=\"font-size: 9px;font-family: &#39;Times New Roman&#39;, serif\">&nbsp;&nbsp;</span><span style=\"font-size: 19px;font-family: Times, serif\">本公司 OTC</span> <span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">全球交易量领先的数字资产</span><span style=\"font-size: 19px;font-family: Times, serif\">OTC(Over The Counter)</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">平台，服务来自超</span><span style=\"font-size: 19px;font-family: Times, serif\">130&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">个国家的数百万用户，日交易额数亿。支持多国法币交易，无缝衔接币币交易，上百种数字货币可供交易。行业首创</span><span style=\"font-size: 19px;font-family: Times, serif\">7x24&nbsp;</span><span style=\"font-size: 19px;font-family: &#39;PingFang SC&#39;, sans-serif\">客户支持，专业服务，交割响应，认证商家安全保障。买卖价差小、交易响应快。满足不同级别资金、不同交易需求。</span> </p><p style=\";font-size: 14px;font-family: DengXian;white-space: normal\"><span style=\"font-size: 16px;font-family: &#39;Times New Roman&#39;, serif\">&nbsp;</span></p><p style=\";text-align: justify;font-size: 14px;font-family: DengXian;white-space: normal\">&nbsp;</p><p><br/></p>', 0, '2019-10-15 14:31:00', '2020-04-29 15:09:28', 'images/zwtp.png', 'images/zwtp.png');
