-- ----------------------------
-- Table structure for otc_details
-- ----------------------------
DROP TABLE IF EXISTS `otc_details`;
CREATE TABLE `otc_details` (
  `id` int NOT NULL AUTO_INCREMENT,
  `master_id` int unsigned NOT NULL DEFAULT '0' COMMENT '商家订单id',
  `currency_id` int unsigned NOT NULL DEFAULT '0' COMMENT '币种id',
  `way` enum('BUY','SELL') DEFAULT NULL COMMENT '用户的交易方向,与商家的订单方向相反',
  `user_id` int unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `seller_id` int unsigned NOT NULL DEFAULT '0' COMMENT '商家id',
  `seller_user_id` int unsigned NOT NULL DEFAULT '0' COMMENT '商家的用户id',
  `buy_user_id` int unsigned NOT NULL DEFAULT '0' COMMENT '买方id',
  `sell_user_id` int unsigned NOT NULL DEFAULT '0' COMMENT '卖方id(不一定是商家)',
  `price` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '价格',
  `number` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '数量',
  `amount` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '金额',
  `pay_voucher` varchar(255) NOT NULL DEFAULT '' COMMENT '支付凭证',
  `status` tinyint NOT NULL DEFAULT '0' COMMENT '状态:0.交易中,1.已付款待确认,2.超时进入延期,3.进入椎权,4.已取消,5.已确认',
  `canceled_at` timestamp NULL DEFAULT NULL COMMENT '取消时间',
  `payed_at` timestamp NULL DEFAULT NULL COMMENT '支付时间',
  `defered_at` timestamp NULL DEFAULT NULL COMMENT '延期时间',
  `arbitrated_at` timestamp NULL DEFAULT NULL COMMENT '仲裁时间',
  `finished_at` timestamp NULL DEFAULT NULL COMMENT '完成时间',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `otc_detail_index` (`master_id`,`currency_id`,`way`,`user_id`,`seller_id`,`seller_user_id`,`buy_user_id`,`sell_user_id`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='法币交易记录';

-- ----------------------------
-- Records of otc_details
-- ----------------------------
BEGIN;
COMMIT;

