-- ----------------------------
-- Table structure for otc_masters
-- ----------------------------
DROP TABLE IF EXISTS `otc_masters`;
CREATE TABLE `otc_masters` (
  `id` int NOT NULL AUTO_INCREMENT,
  `way` enum('BUY','SELL') DEFAULT NULL COMMENT '发布方向',
  `user_id` int unsigned NOT NULL DEFAULT '0',
  `seller_id` int unsigned NOT NULL DEFAULT '0' COMMENT '商家id',
  `currency_id` int unsigned NOT NULL DEFAULT '0' COMMENT '发布币种',
  `area_id` int unsigned NOT NULL DEFAULT '0' COMMENT '商家区域,限定交易的实际兑现币种符号',
  `price` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '价格',
  `total_qty` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '总数量',
  `completed_qty` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '已完成数量',
  `dealing_qty` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '正在交易数量',
  `remain_qty` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '剩余数量',
  `min_number` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '最小交易量',
  `max_number` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '最大交易量',
  `status` tinyint NOT NULL DEFAULT '0' COMMENT '状态:0.暂停交易,1.交易中,2.下架(被下架管理员才能恢复),3.完成,4.取消',
  `payways` varchar(1024) NOT NULL DEFAULT '0' COMMENT '支持的付款方式',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '发布时间',
  `started_at` timestamp NULL DEFAULT NULL COMMENT '开始交易时间',
  `paused_at` timestamp NULL DEFAULT NULL COMMENT '暂停交易时间',
  `stoped_at` timestamp NULL DEFAULT NULL COMMENT '下架交易时间',
  `canceled_at` timestamp NULL DEFAULT NULL COMMENT '撤单时间',
  `finished_at` timestamp NULL DEFAULT NULL COMMENT '完成时间',
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `otc_master_index` (`way`,`user_id`,`seller_id`,`currency_id`,`area_id`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='法币挂单广告';

