  `id` int NOT NULL AUTO_INCREMENT,
  `seller_id` int unsigned NOT NULL DEFAULT '0' COMMENT '商家id',
  `currency_id` int unsigned NOT NULL DEFAULT '0' COMMENT '币种id',
  `completed_buy` decimal(10,0) unsigned NOT NULL DEFAULT '0' COMMENT '累计买入量',
  `completed_sell` decimal(10,0) unsigned NOT NULL DEFAULT '0' COMMENT '累计卖出量',
  `origin_caution_balance` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '原始保证金额度',
  `caution_balance` decimal(20,8) unsigned NOT NULL DEFAULT '0.00000000' COMMENT '当前剩余保证金额度',
  `buy_status` tinyint unsigned NOT NULL DEFAULT '0' COMMENT '挂买权限:0.未启用,1.启用',
  `sell_status` tinyint NOT NULL DEFAULT '0' COMMENT '挂卖权限:0.未启用,1.启用',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='商家币种表';

