-- ----------------------------
-- Table structure for tx_completes
-- ----------------------------
DROP TABLE IF EXISTS `tx_completes`;
CREATE TABLE `tx_completes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `currency_match_id` int NOT NULL DEFAULT '0' COMMENT '交易对',
  `price` decimal(20,4) NOT NULL COMMENT '价格',
  `number` decimal(20,4) NOT NULL COMMENT '交易量',
  `out_user_id` int NOT NULL COMMENT '卖出方',
  `in_user_id` int NOT NULL COMMENT '买入方',
  `way` int NOT NULL DEFAULT '0' COMMENT '买入撮合还是卖出撮合',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `currency_match_id` (`currency_match_id`),
  KEY `in_user_id` (`in_user_id`,`currency_match_id`),
  KEY `out_user_id` (`out_user_id`,`currency_match_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='全站交易表';

-- ----------------------------
-- Table structure for tx_hashes
-- ----------------------------
DROP TABLE IF EXISTS `tx_hashes`;
CREATE TABLE `tx_hashes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `currency_id` int NOT NULL DEFAULT '0' COMMENT '币种ID',
  `hash` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '交易哈希',
  `type` int NOT NULL DEFAULT '0' COMMENT '0，充币，1归拢， 2提币，3 打入手续费',
  `status` int NOT NULL DEFAULT '0' COMMENT '0，等待中，1完成，2失败',
  `memo` varchar(40) CHARACTER SET utf8 NOT NULL COMMENT '备注',
  `user_id` int NOT NULL DEFAULT '0',
  `currency_protocol_id` int NOT NULL DEFAULT '0' COMMENT '币种协议ID',
  `callback_handle` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '更新哈希时的回调方法',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `hash` (`hash`),
  KEY `currency_rx_id` (`currency_id`,`hash`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=371 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='充币哈希表';

-- ----------------------------
-- Records of tx_hashes
-- ----------------------------
BEGIN;
COMMIT;

