-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int NOT NULL AUTO_INCREMENT,
  `uid` varchar(10) NOT NULL DEFAULT '1000000000' COMMENT 'uid',
  `mobile` varchar(255) NOT NULL DEFAULT '' COMMENT '手机',
  `email` varchar(255) NOT NULL DEFAULT '' COMMENT '邮箱',
  `area_id` int NOT NULL DEFAULT '0' COMMENT '区域id',
  `password` varchar(255) NOT NULL DEFAULT '' COMMENT '密码',
  `pay_password` varchar(255) NOT NULL DEFAULT '' COMMENT '支付密码',
  `status` int NOT NULL DEFAULT '1' COMMENT '用户状态1正常2锁定',
  `tx_status` int NOT NULL DEFAULT '1' COMMENT '是否开启交易',
  `parent_id` int NOT NULL DEFAULT '0' COMMENT '上级id',
  `invite_code` varchar(255) NOT NULL DEFAULT '' COMMENT '邀请码',
  `last_login_ip` varchar(50) NOT NULL DEFAULT '' COMMENT '最后登录ip',
  `last_login_at` timestamp NOT NULL DEFAULT '2000-01-01 00:00:00' COMMENT '最后登录时间',
  `parents_path` varchar(2048) NOT NULL DEFAULT '' COMMENT '用户父级关系',
  `agent_id` int NOT NULL DEFAULT '0' COMMENT '对应代理商id',
  `agent_node_id` int NOT NULL DEFAULT '1' COMMENT '所属上级代理商id ',
  `agent_path` varchar(2048) NOT NULL DEFAULT '1' COMMENT '上级代理商关系',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uid` (`uid`),
  KEY `account` (`uid`),
  KEY `invite_code` (`invite_code`),
  KEY `parent_id` (`parent_id`),
  KEY `email` (`email`),
  KEY `mobile` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=226 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='用户表';

